import React from 'react';
// import { Paper } from '@mui/material';
import { TextField } from '@mui/material';
import { Paper } from '@mui/system';

export default function InputField(props) {
  return (
    <Paper
      component="form"
      sx={{ m: 1, width: '552px' }}
      noValidate
      autoComplete="off"
      elevation={10}
    >
      <TextField
        id="outlined-basic"
        label={props.field}
        variant="outlined"
        style={{ margin: 0, textAllign: 'centre', width: 'inherit' }}
      />
    </Paper>
  );
}
